			shellScript = "# Type a script or drag a script file from your workspace to insert its path.\n# Type a script or drag a script file from your workspace to insert its path.\n\nset -e\n\nFRAMEWORK_NAME=\"LinKingArSDK\"\n\nRELEASE_COMMON=\"Release-common\"\n\nprintLog(){\n  echo \"$(date):$1\" >> ${SRCROOT}/frameworkBuild.log\n}\n\n# 判断根目录下是否存在 Build 目录 如果存在删除\nif [ -d \"build\" ];then\n rm -rf \"build\"\nfi\n\n# 进入项目编译目录\ncd ..\n\n# 开始编译模拟器\nxcodebuild -target ${FRAMEWORK_NAME} -configuration Release -arch x86_64 -arch i386 only_active_arch=no defines_module=yes -sdk \"iphonesimulator\" \n\n# 开始编译真机\nxcodebuild -target ${FRAMEWORK_NAME} -configuration Release -arch arm64 -arch armv7  only_active_arch=no defines_module=yes -sdk \"iphoneos\" \n\n\ncp -r \"${SRCROOT}/build/Release-iphoneos/${FRAMEWORK_NAME}\" \"${SRCROOT}/build/${RELEASE_COMMON}\"\n\n# 合成 arm64_armv7_i386_x86_64\nlipo -create \"${SRCROOT}/build/Release-iphoneos/${FRAMEWORK_NAME}/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" \"${SRCROOT}/build/Release-iphonesimulator/${FRAMEWORK_NAME}/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\" -o \"${SRCROOT}/build/${RELEASE_COMMON}/${FRAMEWORK_NAME}.framework/${FRAMEWORK_NAME}\"\n\nPRODUCT_PATH=\"${FRAMEWORK_NAME}/Products/${FRAMEWORK_NAME}.framework\"\n\n# 删除已存在\nif [ -d \"${PRODUCT_PATH}\" ];then\n rm -rf \"${PRODUCT_PATH}\"\nfi\n\n# copy 到Products目录\ncp -r \"${SRCROOT}/build/${RELEASE_COMMON}/${FRAMEWORK_NAME}.framework\" \"${FRAMEWORK_NAME}/Products/\"\n\nprintLog \"编译合成完成\"\nopen .\n";
